def dataRowUserById(pars_row, head):
    row=[]
    num=0
    while num < 47:
        if head[num] in pars_row:
            str_el=''
            if num==0:
                if len(pars_row['bdate'])>5:
                    year = pars_row['bdate'][-5,-1]
                    row.append(year)
                else:
                    row.append('-')
            if 0<num<9 or 10<num<15 or 15<num<23 or 23<num<34 or 34<num<42 or num==45:
                row.append(pars_row[head[num]])
            if 8<num<11:
                row.append(pars_row[head[num]]['title'])
            if num==15:
                for el in ['skype', 'instagram', 'facebook', 'facebook_name', 'twitter', 'livejournal']:
                    if el in pars_row:
                        str_el=str_el+'+ '
                row.append(str_el)
            if num==23:
                if 'name' and 'type' in pars_row[head[num]]:
                    str_el=pars_row[head[num]]['name']+' '+pars_row[head[num]]['type']
                row.append(str_el)
            if num == 34:
                if len(pars_row[head[num]])>0:
                    # print(num, head[num], pars_row[head[num]])
                    for el in pars_row[head[num]]:
                        for key in el:
                            str_el= str_el+key+'-'+str(el[key])+', '
                row.append(str_el)
            if num==42:
                if len(pars_row[head[num]])>0:
                    row.append('+')
                else:
                    row.append('-')
            if num == 43:
                # print(num, head[num], pars_row[head[num]])
                if len(pars_row[head[num]])>0:
                    for el in pars_row[head[num]]:
                        str_el=str_el+el['name']+', '
                row.append(str_el)
            if num==44:
                count=0
                for el in pars_row[head[num]]:
                    count= count+1
                row.append(count)
            if num ==46:
                count=0
                if len(pars_row[head[num]])>0:
                    count=1
                row.append(count)
        else:
            row.append('-')
        num=num+1
    return row

def dataUserDyId(pars, head):
    for el in pars:
        rowElement=dataRowUserById(el, head)
        data.append(rowElement)
    return data



def xl(data_list, id):
    wb = openpyxl.Workbook()

    # добавляем новый лист
    wb.create_sheet(title='Первый лист', index=0)
    # получаем лист, с которым будем работать
    sheet = wb['Первый лист']
    for col, title in zip(range(1, len(head)+3), head):
        cell = sheet.cell(row=1, column=col)
        cell.value = title
    for row, data_row in zip(range(2, len(data_list) + 2), data_list):
        for col, inform in zip(range(1, len(data_row) + 5), data_row):
            cell = sheet.cell(row=row, column=col)
            cell.value = inform

    wb.save('data\\'+str(id)+'\\'+str(id)+'_users_by_id.xlsx')


